import { Box, Card, Typography } from "@mui/material";
import { Container } from "@mui/system";
import React from "react";

function IntroducePage() {
  return (
    <Container>
      <Card>
        <Typography
          sx={{
            fontSize: 25,
            m: 3,
          }}
        >
          Introduce
        </Typography>
        <Typography
          sx={{
            fontSize: 18,
            mr: 1,
          }}
        >
          MINI FOOD là hệ thống cửa hàng phân phối thân thiện, chuyên cung cấp
          các sản phẩm Organic từ Đà Lạt Farm. Chúng tôi mang những sản phấm
          chất lượng vì sức khỏe đến tay người tiêu dùng.
        </Typography>
        <Box
        sx={{
            display:"flex",
            justifyContent:"center"
        }}
        >
        <Box
          component="img"
          sx={{
            width: 1000,
            height: "100%",
            ml: 1,
            mt: 1,
            borderRadius: 1,
            
          }}
          src="/images/introduce.png"
          alt="product"
        />
         </Box>
      </Card>
    </Container>
  );
}

export default IntroducePage;
